              <th>Flag ID</th>
              <th>User ID</th>
              <th>Post ID</th>
              <th>Post Type</th>
              <th>Go To</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>test ID</td>
              <td>test User ID</td>
              <td>test Post ID</td>
              <td>test Post Type</td>
              <td>
                <button className = "btn btn-success">
                  Go To
                </button>
              </td>
            </tr>
          </tbody>
        </table>
    </Fragment>
};

export default ListReports;
